&lt;p&gt;One thing I love about digital photography is the fact I find my photos to be works in progress.  I will often revisit old raw files and either through my own increased knowledge of the process or just looking at a scene with a fresh eye come up with different takes on a scene.  Another aspect that appeals to me is that while doing this I relive the experience of taking the picture.  Because I'm actually creating an image in the process, possibly reflecting changes in my own way of looking at the world, I find it much more satisfying than pouring over old photo albums.  I made this photo in Arches N.P. during my first trip there in 2007.&lt;br /&gt;
