Desert flowers in Wadi Rum -Valley of The Moon, South of Jordan.&lt;br /&gt;
This stunning landscape has been the location of many films like Lawrence of Arabia, Transformers -Revenge of The Fallen and Red Planet among many others.&lt;br /&gt;
Its particular red sand makes it look like Mars&lt;br /&gt;
&lt;br /&gt;
Wadi Rum (Arabic: وادي رم‎) also known as The Valley of the Moon (Arabic: وادي القمر‎) is a valley cut into the sandstone and granite rock in south Jordan at 60 km to the east of Aqaba. It is the largest wadi in Jordan. The name Rum most likely comes from an Aramaic root meaning 'high' or 'elevated'. To reflect its proper Arabic pronunciation, archaeologists transcribe it as Wadi Ramm. The highest elevation in Wadi rum is Mount Um Dami at more than 1800m above sea level. Wikipedia&lt;/p&gt;

